import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/">
          <div>Home</div>
        </Route>
        <Route exact path="/:user">
          <div>User</div>
        </Route>
        <Route path="/:user/repositories">
          <div>Repo</div>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
